<?php

/* @var $factory \Illuminate\Database\Eloquent\Factory */


use App\Applicant;
use Faker\Generator as Faker;

$factory->define(Applicant::class, function (Faker $faker) {
    $profile_image = $faker->randomElement(['data:image/png;base64,']);
    $gender = $faker->randomElement(['Male', 'Female']);
    $marital_status = $faker->randomElement(['Single', 'Married']);
    $highest_educational_level = $faker->randomElement(['SHS', '1st Degree', '2nd Degree']);
    $last_educational_institution_attended = $faker->randomElement(['KNUST', 'UCC', 'UG', 'UDS', 'UEW']);
    $course = $faker->randomElement([
        'Electronic Engineering Technology',
        'Cosmetology',
        'Garment Making',
        'English Language',
        'Entrepreneurship',
        'Mathematics',
        'Science',
        'ICT',
        'Interpersonal Skills',
        'Fashion Design Technology',
        'Hospitality And Catering Management',
        'Citrus Value Chain',
        'Pineapple Value Chain'
    ]);
    $cv = $faker->randomElement(['data:application/pdf;base64,']);
    $highest_educational_cert = $faker->randomElement(['data:application/pdf;base64,']);

    return [
        'profile_image' => $profile_image,
//        'title' => $faker->name,
        'last_name' => $faker->lastName($gender),
        'first_name' => $faker->firstName($gender),
//        'other_names' => $faker->name,
        'gender' => $gender,
        'dob' => $faker->dateTimeBetween('1990-01-01', '2002-12-31')->format('d/m/Y'),
        'marital_status' => $marital_status,
        'primary_contact' => $faker->phoneNumber,
        'auxiliary_contact' => $faker->phoneNumber,
        'email' => $faker->unique()->safeEmail,
        'residential_address' => $faker->address,
        'postal_address' => $faker->streetAddress,
        'last_educational_institution_attended' => $last_educational_institution_attended,
        'highest_educational_level' => $highest_educational_level,
        'occupation' => $faker->jobTitle,
        'years_of_working_experience' => $faker->numberBetween(0, 15),
        'cv' => $cv,
        'highest_educational_cert' => $highest_educational_cert,
        'course' => $course
    ];
});
